CREATE TABLE campus_info(
   id_info             INTEGER(255) NOT NULL PRIMARY KEY 
  ,wrld_rank           VARCHAR(255) NOT NULL
  ,nama_univ           VARCHAR(255) NOT NULL
  ,lokasi              VARCHAR(255) NOT NULL
  ,number_students     VARCHAR(255) NOT NULL
  ,student_staff_ratio VARCHAR(255) NOT NULL
  ,pc_intl_students    VARCHAR(255) NOT NULL
  ,female_male_ratio   VARCHAR(255) NOT NULL
  ,tanggal             INTEGER(255) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

CREATE TABLE `international_outlook` (
  `id_int_outlook` int(255) PRIMARY KEY NOT NULL,
  `nama_univ` varchar(255) NOT NULL,
  `int_outlook` varchar(255) NOT NULL,
  `rank_int_outlook` varchar(255) NOT NULL,
  `tanggal` INT(255) NOT NULL,
  `id_info` int(255) NOT NULL,
  FOREIGN KEY (id_info) REFERENCES campus_info (id_info)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

CREATE TABLE `research` (
  `id_rsc` int(255) PRIMARY KEY NOT NULL,
  `nama_univ` varchar(255) NOT NULL,
  `research` varchar(255) NOT NULL,
  `rank_rsc` varchar(255) NOT NULL,
  `tanggal` INT(255) NOT NULL,
  `id_info` int(255) NOT NULL,
  FOREIGN KEY (id_info) REFERENCES campus_info (id_info)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

CREATE TABLE `industry_income` (
  `id_inc` int(255) PRIMARY KEY NOT NULL,
  `nama_univ` varchar(255) NOT NULL,
  `income` varchar(255) NOT NULL,
  `rank_inc` varchar(255) NOT NULL,
  `tanggal` int(255) NOT NULL,
  `id_info` int(255) NOT NULL,
  FOREIGN KEY (id_info) REFERENCES campus_info (id_info)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

CREATE TABLE `citation` (
  `id_ctn` int(255) PRIMARY KEY NOT NULL,
  `nama_univ` varchar(255) NOT NULL,
  `citation` varchar(255) NOT NULL,
  `rank_ctn` varchar(255) NOT NULL,
  `tanggal` int(255) NOT NULL,
  `id_info` int(255) NOT NULL,
  FOREIGN KEY (id_info) REFERENCES campus_info (id_info)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

CREATE TABLE `teaching` (
  `id_teaching` int(255) PRIMARY KEY NOT NULL,
  `nama_univ` varchar(255) NOT NULL,
  `teaching` varchar(255) NOT NULL,
  `rank_teaching` VARCHAR(255) NOT NULL,
  `tanggal` int(255) NOT NULL,
  `id_info` int(255) NOT NULL,
  FOREIGN KEY (id_info) REFERENCES campus_info (id_info)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

CREATE TABLE `overall` (
  `id_ova` int(255) PRIMARY KEY NOT NULL,
  `wrld_rank` VARCHAR(255) NOT NULL,
  `nama_univ` varchar(255) NOT NULL,
  `lokasi` varchar(255) NOT NULL,
  `score_ova` varchar(255) NOT NULL,
  `teaching` varchar(255) NOT NULL,
  `rank_teaching` VARCHAR(255) NOT NULL,
  `research` varchar(255) NOT NULL,
  `rank_rsc` varchar(255) NOT NULL,
  `citation` varchar(255) NOT NULL,
  `rank_ctn` varchar(255) NOT NULL,
  `income` varchar(255) NOT NULL,
  `rank_inc` varchar(255) NOT NULL,
  `int_outlook` varchar(255) NOT NULL,
  `rank_int_outlook` varchar(255) NOT NULL,
  `tanggal` int(255) NOT NULL,
  `id_info`INTEGER(255) NOT NULL,
  `id_ctn`INTEGER(255) NOT NULL,
  `id_inc`INTEGER(255) NOT NULL,
  `id_rsc`INTEGER(255) NOT NULL,
  `id_int_outlook`INTEGER(255) NOT NULL,
  `id_teaching`INTEGER(255) NOT NULL,

  FOREIGN KEY (id_info) REFERENCES campus_info (id_info),
  FOREIGN KEY (id_ctn) REFERENCES citation (id_ctn),
  FOREIGN KEY (id_rsc) REFERENCES research (id_rsc),
  FOREIGN KEY (id_inc) REFERENCES industry_income (id_inc),
  FOREIGN KEY (id_int_outlook) REFERENCES international_outlook (id_int_outlook),
  FOREIGN KEY (id_teaching) REFERENCES teaching (id_teaching)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;


